@Test
  public void yearEnd() {
    Date date = DateUtils.yearEnd();
    assertNotNull(date);
    GregorianCalendar calendar = new GregorianCalendar();
    calendar.setTime(date);
    assertEquals(11, calendar.get(MONTH));
    assertEquals(31, calendar.get(DAY_OF_MONTH));
  }

