public static Date yearEnd() {
    final GregorianCalendar calendar = new GregorianCalendar(US);
    calendar.add(YEAR, 1);
    calendar.set(DAY_OF_YEAR, 1);
    calendar.add(DAY_OF_YEAR, -1);
    return calendar.getTime();
  }
